style.css:
/* Target the specific website by its URL */
@-moz-document url-prefix("https://www.matematikfessor.dk/") {
  /* Your CSS styles go here */

  /* Example: Change the background color */
  body {
    background-color: #F0F0F0;
  }

  /* Example: Change the text color */
  p {
    color: #333;
  }

  /* Example: Increase font size for headings */
  h1, h2, h3 {
    font-size: 24px;
  }
}
